@BishopJakes and his powerful word is coming to @REVOLTTV

@BishopJakes is one of the most transformational leaders of our time who has made a huge impact on my life. We’re honored for him to join the @REVOLTTV family and use his gift to empower the culture. 

This partnership is a landmark moment for REVOLT, expanding into the faith space to create a program that will inspire millions around the world to have hope and walk in their power. 

Tune in to #KingdomCulture every Sunday only on @RevoltTV!!
